import React from "react";
import { Text } from "react-native";

export default function People() {
  const url = "https://swapi.dev/api/people/";
  console.log(url);

  const [people, setPeople] = React.useState("Loading...");

  console.log(people);

  React.useEffect(() => {
    setPeople("Loading...");
    fetch(url)
      .then((data) => data.json())
      .then((ppl) => {
        console.log(ppl);
        if (ppl) setPeople(ppl);
        else setPeople("Error");
      });
  }, []);

  return <Text>{people}</Text>;
}
